import packageImg from '../img/package.png'

function Projects () {
    let projectsList = []
    let state = 0

    if (projectsList) {
        state = 1
    }
    return (
        <div>
            {state ? <div></div> : <img src={packageImg} alt='Empty' />}
        </div>
    )
}

export default Projects
